import React from "react";

const PreviewPDF = ({ images }) => {
  return (
    <div>
      <h2>PDF Preview</h2>
      <div>
        {images.map((image, index) => (
          <div key={index}>
            <img src={image.preview} alt={`Preview ${index + 1}`} />
            <span>Page {index + 1}</span>
          </div>
        ))}
      </div>
    </div>
  );
};

export default PreviewPDF;
